import UserCard from "./UserCard/UserCard";
import "./app.scss";


function App() {
  const users = [
    {
      name: "Victor Crest1111",
      age: 13,
      imgUrl:
        "../mika.jpg",
      location: "Kyrgystan",
      stat: {
        followers: "560K",
        likes: "250K",
        photos: "150K",
      },
    },
    {
      name: "Victor Crest1111",
      age: 26,
      imgUrl:
        "../mika.jpg",
      location: "Kyrgystan",
      stat: {
        followers: "560K",
        likes: "250K",
        photos: "150K",
      },
    },
    {
      name: "Victor Crest1111",
      age: 17,
      imgUrl:
        "https://i.pinimg.com/564x/03/2a/73/032a7370315674fbd6ff7ffd3d3e3d38.jpg",
      location: "Kyrgystan",
      stat: {
        followers: "560K",
        likes: "250K",
        photos: "150K",
      },
    },
  ];

  return (
    <div className="app">
      {users.map((user, idx) => {
        return (
          <UserCard
            userName={user.name}
            userAge={user.age}
            userImg={user.imgUrl}
            userLocation={user.location}
            userFollowers={user.stat.followers}
            userLikes={user.stat.likes}
            userPhotos={user.stat.photos}
            key={idx}
          />
        );
      })}
    </div>
  );
}

export default App;
